import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import "./Nav.css";
import Dropdown from "../components/Dropdown/Dropdown";
import Axios from "axios";

const fetchUrlsBasedonCatId = () => {
  Axios.post("/");
};

class Nav extends Component {
  render() {
    const {
      match: { params }
    } = this.props;

    componentDidMount = () => {
      //api call with cat id
      fetchUrlsBasedonCatId(params.catid);
    };

    return (
      <form className="form">
        <div>
          <h1>List of URLs</h1>
        </div>
        <div>
          <Dropdown
            fetchurls={true}
            fetchUrlsBasedonCatId={fetchUrlsBasedonCatId}
            categoryId={params.catId}
          />
        </div>
      </form>
    );
  }
}
export default withRouter(Nav);
